import React, { Component } from 'react';
import StaffService from '../services/StaffService';

class ListStaffComponent extends Component {
    constructor(props){
        super(props)

        this.state = {

            staffs: []

        }
    }
    componentDidMount(){
        StaffService.getEmployees().then((res) => {
            this.setState({staffs : res.data});
        });
    }
    render() {
        return (
            <div>
                <h2 className="text-center">Staff List</h2>
                <div className="row">
                    <button className="btn btn-" onClick={this.addSatffs}>Add Staff</button>

                </div>
                <div className= "row">
                    <table className = "table table-striped table-bordered">

                        <thead>
                            <tr>
                                <th>Staff Id</th>
                                <th>Staff Frist Name</th>
                                <th>Staff Last Name</th>
                                <th>Staff Email</th>
                                <th>Staff Address</th>
                                <th>Staff PhoneNumber</th>
                                <th>Actions</th>

                            </tr>
                        </thead>
                        <tbody>
                            {
                                this.state.staffs.map(
                                    staff => 
                                    <tr key = {staff.id}>
                                        <td> {staff.id}</td>

                                        <td> {staff.firstName}</td>
                                        <td> {staff.lastName}</td>
                                        <td> {staff.email}</td>
                                        <td> {staff.address}</td>
                                        <td> {staff.phoneNumber}</td>
                                    </tr>
                                )
                            }

                        </tbody>

                    </table>

                </div>

            </div>
        );
    }
}

export default ListStaffComponent;
